import Link from "next/link";
import Layout from "../components/Layout";
import { Provider } from "react-redux";
import Store from "../redux/store";
export default () => {
  const store = Store();

  return (
    <Provider store={store}>
      <Layout title="Home">
        <Link href="/subjects">
          <h1>Subject Wise</h1>
        </Link>

        <Link href="/years">
          <h1>Year Wise</h1>
        </Link>
      </Layout>
    </Provider>
  );
};
